(26, '335323586336510', '335323586336510_122131639028361405', 'In a series of unfolding events that has sent ripples across the geopolitical landscape, U.S. officials have come forward with startling revelations. They assert that Iran is actively aiding Yemen‚Äôs Houthi rebels in targeting and downing U.S. Reaper drones. This marks a significant escalation in the already tumultuous Middle Eastern theater, where proxy wars and direct confrontations have become the unsettling norm.', '2024-09-23 13:52:24', '2024-09-23 13:52:24', 4, 0, 1),
