(28, '335323586336510', '335323586336510_122131512356361405', 'In a riveting showdown at Ninoy Aquino Stadium, the Converge FiberXers delivered a game to remember, edging out Meralco Bolts with a 105-97 victory. Alec Stockton emerged as the hero of the night, knocking down crucial shots in the dying moments to seal the win and elevate Converge‚Äôs standing in Group A of the PBA Governors‚Äô Cup.', '2024-09-23 13:52:26', '2024-09-23 13:52:26', 1, 0, 0),
(29, '335323586336510', '335323586336510_122131464866361405', 'Debbie Harry, the iconic frontwoman of Blondie, has proven once again that age is just a number. At 79 years old, she has left fans and critics alike in awe with her recent appearance in a new eyewear campaign video. It‚Äôs almost as if she has discovered the fountain of youth, blending timeless beauty with her signature rock-and-roll edge. This isn‚Äôt just about fashion; it‚Äôs a testament to her enduring influence in the music and style industries.', '2024-09-23 13:52:26', '2024-09-23 13:52:26', 4, 0, 1),
(30, '335323586336510', '335323586336510_122131435562361405', 'In a groundbreaking medical feat, cardiac surgeons at the King Faisal Specialist Hospital and Research Center (KFSHRC) in Saudi Arabia performed the world‚Äôs first robotic heart surgery on a 16-year-old patient suffering from end-stage heart failure. This historic procedure, reported by the healthcare news website Cardiovascular Business, marks a significant leap forward in the field of cardiac care, illustrating the growing role of robotics in medical treatment.', '2024-09-23 13:52:27', '2024-09-23 13:52:27', 0, 0, 0),
(31, '335323586336510', '335323586336510_122131335230361405', 'Mark your calendars for September 19, 2024, at 4:00 PM Eastern Time for the Virtual Investor Closing Bell Series! Join us as CEO Russell Trenary unveils the groundbreaking approval of a new treatment for wet age-related macular degeneration in Europe and the UK. Gain exclusive insights into the European success story and hear firsthand about our strategic goals and ambitious expansion plans into the United States. Don‚Äôt miss this opportunity to stay ahead in the investment world and learn about this innovative advancement in eye care.\n\nLike and share this video to spread the word!\n\n#InvestorSeries #VirtualEvent #CEOAnnouncement #MacularDegeneration #HealthcareInnovation #InvestmentOpportunities #USExpansion', '2024-09-23 13:52:28', '2024-09-23 13:52:28', 0, 0, 0),
(32, '335323586336510', '335323586336510_122131315064361405', 'Step into nostalgia with Trigger\'s latest masterpiece in their Transformers tribute video! Relive the golden era with awe-inspiring animation quality and mind-blowing transformation sequences that showcase meticulous detail. Experience the breathtaking soundtrack that perfectly complements each action-packed moment, making this a must-watch for both long-time fans and newcomers to the Transformers universe. Don\'t miss out on this tribute that perfectly blends the past and the present!\n\nEnjoyed the video? Give it a thumbs up and share it with fellow Transformers enthusiasts!\n\n#Transformers #Animation #Nostalgia #Trigger #TributeVideo #80sCartoons #TransformAndRollOut', '2024-09-23 13:52:29', '2024-09-23 13:52:29', 1, 0, 0),
(33, '335323586336510', '335323586336510_122131304912361405', 'In the high-stakes world of professional football, it‚Äôs often said that games are won and lost in the trenches. The Chicago Bears, a team historically renowned for its fierce defenses, are once again proving this adage true with a remarkable performance on the line of scrimmage. This season, the Bears have quietly been dominating an essential metric that could make or break their playoff hopes: the efficiency of their offensive and defensive lines.', '2024-09-23 13:52:29', '2024-09-23 13:52:29', 1, 0, 0),
(34, '335323586336510', '335323586336510_122131266686361405', 'iOS 18 vs iOS 17: What‚Äôs New?\nDiscover the future of mobile tech with our latest video! Dive into the world of *Smart Widgets* that intelligently adapt to your habits, providing proactive information right when you need it. Explore the upgraded *Dynamic Island*, now fully interactive, enabling seamless control over your music, notifications, and messages. Plus, get hands-on with the enhanced camera features, including *ProRAW editing* directly within the Photos app. Elevate your mobile experience with these cutting-edge innovations! If you enjoyed the video, please like and share it with your friends! #SmartWidgets #DynamicIsland #ProRAW #MobileTech #TechInnovation #SmartphoneFeatures', '2024-09-23 13:52:30', '2024-09-23 13:52:30', 0, 0, 0),
(35, '335323586336510', '335323586336510_122131257404361405', 'In a world where freedom often means being tethered to a predictable path, the Rubishack shatters conventional living with a robust declaration of independence. It‚Äôs not just a tiny house; it‚Äôs a revolution on wheels, daring anyone to embrace the wilderness. Mounted on a formidable Cummins truck, the Rubishack is engineered to brave the untamed landscapes that lay beyond the beaten tracks. Imagine rolling over rugged terrain, gliding past daunting obstacles, and finding solace in nature‚Äôs heart, all the while having your entire home right behind you.', '2024-09-23 13:52:31', '2024-09-23 13:52:31', 1, 0, 0),
(36, '335323586336510', '335323586336510_122131116074361405', 'Discover the unfolding controversy around the ‚Çπ52 crore allocated for reconstructing the Hatkeshwar flyover. Opposition parties are raising alarms about potential irregularities, sparking a heated debate. Built in 2017 and closed in 2022 due to structural issues, the flyover\'s demolition and reconstruction have left the public skeptical despite government assurances on safety and cost recovery from the original contractor. Join us as we explore the pressing demands for transparency and an independent audit. Don\'t miss out on this deep dive into a critical infrastructure issue affecting many. #HatkeshwarFlyover #InfrastructureIssues #PublicTransparency #GovernmentAccountability #ConstructionControversy #FlyoverReconstruction #PublicSafety', '2024-09-23 13:52:32', '2024-09-23 13:52:32', 0, 0, 0),
(37, '335323586336510', '335323586336510_122131101134361405', 'Robert Jenrick\'s proposal to cut over 100,000 civil service jobs aims to create a more efficient government. While supporters believe this move will streamline operations, critics voice concerns about the potential negative impact on public services and job security. Public opinion is sharply divided: civil servants express anxiety over their future, while some small business owners see potential benefits. Join us as we explore the different perspectives and implications of this controversial decision. Don\'t forget to like and share this video if you found it informative.\n\n#CivilServiceCuts #RobertJenrick #GovernmentEfficiency #PublicServices #JobSecurity #SmallBusiness #PublicOpinion', '2024-09-23 13:52:32', '2024-09-23 13:52:32', 0, 0, 0),
(38, '335323586336510', '335323586336510_122131086614361405', 'Rocket Lab\'s successful launch of the \'Photon\' satellite has created a surge in their stock value, showcasing the power of technological advancements in the aerospace industry. Meanwhile, Rentokil is grappling with supply chain issues and labor shortages, leading to a profit warning and a decline in investor confidence. This video delves into the contrasting performances of Rocket Lab and Rentokil, illustrating the volatility and critical need for innovation within the industrial sector. Don\'t forget to like and share this video to stay updated on the latest market trends and industry innovations!\n\n#RocketLab #PhotonSatellite #Rentokil #StockMarket #IndustryTrends #Innovation #InvestmentNews', '2024-09-23 13:52:33', '2024-09-23 13:52:33', 0, 0, 0),
